import React, { useState } from 'react';
import { Card, CardContent, Typography, Button, TextField, CircularProgress } from '@mui/material';
import { useEffect } from 'react';

const GetStudentByAdmissionNumberForm = () => {
  const [admissionNumber, setAdmissionNumber] = useState('');
  const [studentData, setStudentData] = useState(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);

  const handleChange = (event) => {
    setAdmissionNumber(event.target.value);
    if (error) setError(null);
  };

  const handleSubmit = async (event) => {
    event.preventDefault();
    if (!admissionNumber.trim()) {
      setError('Admission number cannot be empty.');
      return;
    }

    setStudentData(null); // Clear previous student data
    setLoading(true);

    const abortController = new AbortController(); // To support request timeout
    const timeoutId = setTimeout(() => abortController.abort(), 5000);

    try {
      const response = await fetch(`http://localhost:5000/students/${admissionNumber}`, {
        signal: abortController.signal,
      });

      if (response.ok) {
        const data = await response.json();
        setStudentData(data); // Save fetched student data
      } else if (response.status === 404) {
        setError('Student not found.');
      } else {
        setError('Error retrieving student data.');
      }
    } catch (e) {
      if (e.name === 'AbortError') {
        setError('Request timed out. Please try again.');
      } else {
        setError('An error occurred while fetching data. Please try again later.');
      }
    } finally {
      clearTimeout(timeoutId); // Clear the timeout
      setLoading(false); // Stop the loading spinner
    }
  };

  return (
    <Card sx={{ maxWidth: 600, margin: '0 auto', marginTop: 20 }}>
      <CardContent>
        <center>
          <Typography variant="h5" gutterBottom>
            Enter Admission Number
          </Typography>
        </center>
        <form onSubmit={handleSubmit}>
          <TextField
            fullWidth
            label="Admission Number"
            value={admissionNumber}
            onChange={handleChange}
            placeholder="Enter Admission Number"
            variant="outlined"
            margin="normal"
          />
          <center>
            <Button type="submit" variant="contained" color="primary" disabled={loading}>
              {loading ? <CircularProgress size={24} /> : 'Search'}
            </Button>
          </center>
        </form>
        {error && (
          <Typography variant="body1" color="error" style={{ marginTop: 20 }}>
            {error}
          </Typography>
        )}
        {studentData && (
          <>
            <Typography variant="h5" style={{ marginTop: 20 }}>
              Student Information
            </Typography>
            <Typography><strong>Full Name:</strong> {studentData.fullName}</Typography>
            <Typography><strong>Gender:</strong> {studentData.gender}</Typography>
            <Typography><strong>Age:</strong> {studentData.age}</Typography>

            {studentData.certificates?.length > 0 && (
              <div>
                <Typography variant="h5" style={{ marginTop: 20 }}>
                  Certificates
                </Typography>
                {studentData.certificates.map((cert, index) => (
                  <div key={index}>
                    <Typography variant="body1"><strong>Certificate {index + 1}</strong></Typography>
                    {cert.photo && (
                      <img src={cert.photo} style={{ width: '200px', height: '200px' }} />
                    )}
                  </div>
                ))}
              </div>
            )}
          </>
        )}
      </CardContent>
    </Card>
  );
};

export default GetStudentByAdmissionNumberForm;
